function Login(){

    return (//onSubmit={}--
        <div>
            <div>로그인</div>
            <form>
                    <label htmlFor="username">아이디:</label>
                    <input
                        type="text"
                        id="username"
                        name="username"
                        value={this.state.username}
                        onChange={this.handleInputChange}
                        required
                    /><p/>
                    <label htmlFor="password">비밀번호:</label>
                    <input
                        type="password"
                        id="password"
                        name="password"
                        value={this.state.password}
                        onChange={this.handleInputChange}
                        required
                    /><br/>
                    <button type="submit">로그인</button>
                </form>
        </div>
    );
}


export default Login;
